import React from 'react'
import '../assets/css/JoinSpace.css';

const JoinSpace = () => {
    return (
        <div class="col-12 justify-content-center">
            <h2>Join Space <span>Holberton</span></h2>
        </div>
    );
}

export default JoinSpace;
